import React from 'react'
import './radio.css'
var bcrypt = require("bcryptjs")

function go() {
    
    let hash = localStorage.getItem("hash")
    let decide = bcrypt.compare("bcrypt-connection-secured", hash)
    if (decide === true) {
        window.location = '/home'
    }
}


class top extends React.Component {
    render() {
        return (
            <div>
                <h1>Hello!</h1> <br /> <h2>welcome to the secret world of PADAH (Professional Agency of Detectives And Hackers).
            <br /> Now you will be directed to your Home Page.
            <br /></h2>



                <section className="button">
                {// eslint-disable-next-line
                }<a class="animated-button1" onClick={go}>
                        <span></span>
                        <span></span>
                        <span></span>
                        <span></span>
                        Go to home
                </a>
                </section>
            </div>
        )
    }
}

export default top;
